import Login from "./pages/Login";
import Cadastro from "./pages/Cadastro";
import Rotas from "./pages/Routes";

function App() {
  return (
    <div className="App">
      <h1 className="login">Login</h1>
      <Login />
      <h2 className="login">Cadastro</h2>
      <Cadastro />
      <h3 className="Rotas">Teste Rotas</h3>
    </div>
  );
}

export default App;
